import React, { useEffect, useRef, useState } from 'react';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

// Fix Leaflet default icon issue
import icon from 'leaflet/dist/images/marker-icon.png';
import iconShadow from 'leaflet/dist/images/marker-shadow.png';

let DefaultIcon = L.icon({
  iconUrl: icon,
  shadowUrl: iconShadow,
  iconSize: [25, 41],
  iconAnchor: [12, 41]
});

L.Marker.prototype.options.icon = DefaultIcon;

const ORS_API_KEY = '5b3ce3597851110001cf6248f3c7d707f6f94f1c9315484e33df5f03';
const ORS_DIRECTIONS_URL = 'https://api.openrouteservice.org/v2/directions/driving-car/geojson';

async function fetchRouteSegment(from, to) {
  try {
    const body = {
      coordinates: [
        [from.lng, from.lat],
        [to.lng, to.lat],
      ],
    };

    const response = await fetch(ORS_DIRECTIONS_URL, {
      method: 'POST',
      headers: {
        Authorization: ORS_API_KEY,
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(body),
    });

    if (!response.ok) {
      console.warn('OpenRouteService API error:', response.status, response.statusText);
      return null;
    }

    const data = await response.json();
    if (!data.features || !data.features.length) {
      console.warn('OpenRouteService returned no route for segment');
      return null;
    }

    return data.features[0].geometry.coordinates.map((coord) => [
      coord[1],
      coord[0],
    ]);
  } catch (error) {
    console.error('Error fetching route segment from OpenRouteService:', error);
    return null;
  }
}

async function buildRoadRoute(latLngs) {
  const fullRoute = [];

  for (let i = 0; i < latLngs.length - 1; i++) {
    const from = { lat: latLngs[i][0], lng: latLngs[i][1] };
    const to = { lat: latLngs[i + 1][0], lng: latLngs[i + 1][1] };

    const segment = await fetchRouteSegment(from, to);

    if (segment && segment.length) {
      if (fullRoute.length) {
        segment.shift();
      }
      fullRoute.push(...segment);
    } else {
      fullRoute.push(latLngs[i], latLngs[i + 1]);
    }
  }

  return fullRoute;
}

function MapView({ itinerary, startLocation, neighbourhoods }) {
  const mapRef = useRef(null);
  const mapInstanceRef = useRef(null);
  const markersRef = useRef([]);
  const polylineRef = useRef(null);
  const [routeLoaded, setRouteLoaded] = useState(false);

  useEffect(() => {
    if (!mapInstanceRef.current && mapRef.current) {
      const nairobiCenter = [-1.286389, 36.817223];
      mapInstanceRef.current = L.map(mapRef.current).setView(nairobiCenter, 12);

      L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        maxZoom: 19,
        attribution: '&copy; OpenStreetMap contributors',
      }).addTo(mapInstanceRef.current);
    }

    return () => {
      if (mapInstanceRef.current) {
        mapInstanceRef.current.remove();
        mapInstanceRef.current = null;
      }
    };
  }, []);

  useEffect(() => {
    const updateMap = async () => {
      if (!mapInstanceRef.current) return;

      // Clear previous markers and polylines
      markersRef.current.forEach((m) => m.remove());
      markersRef.current = [];
      if (polylineRef.current) {
        polylineRef.current.remove();
        polylineRef.current = null;
      }

      if (!neighbourhoods) {
        const nairobiCenter = [-1.286389, 36.817223];
        mapInstanceRef.current.setView(nairobiCenter, 12);
        return;
      }

      const stops = itinerary?.stops || [];
      const latLngs = [];

      // Start marker
      const startCenter = startLocation ? neighbourhoods[startLocation] : null;
      if (startCenter) {
        const marker = L.marker([startCenter.lat, startCenter.lng], {
          title: `Start: ${startLocation}`,
        }).addTo(mapInstanceRef.current);
        marker.bindPopup(`<b>Start</b><br>${startLocation}`);
        markersRef.current.push(marker);
        latLngs.push([startCenter.lat, startCenter.lng]);
      }

      // Stop markers
      stops.forEach((stop, idx) => {
        const { place } = stop;
        const { lat, lng } = place.coords;
        latLngs.push([lat, lng]);
        const marker = L.marker([lat, lng], {
          title: `${idx + 1}. ${place.name}`,
        }).addTo(mapInstanceRef.current);
        marker.bindPopup(
          `<b>${idx + 1}. ${place.name}</b><br>${place.category} Â· ${place.neighbourhood}`
        );
        markersRef.current.push(marker);
      });

      if (latLngs.length > 1) {
        setRouteLoaded(false);
        const roadRouteLatLngs = await buildRoadRoute(latLngs);

        if (roadRouteLatLngs.length) {
          polylineRef.current = L.polyline(roadRouteLatLngs, {
            color: '#22c55e',
            weight: 4,
            opacity: 0.9,
          }).addTo(mapInstanceRef.current);

          mapInstanceRef.current.fitBounds(polylineRef.current.getBounds(), { padding: [24, 24] });
        }
        setRouteLoaded(true);
      } else if (latLngs.length === 1) {
        mapInstanceRef.current.setView(latLngs[0], 12);
      } else {
        const nairobiCenter = [-1.286389, 36.817223];
        mapInstanceRef.current.setView(nairobiCenter, 12);
      }
    };

    updateMap();
  }, [itinerary, startLocation, neighbourhoods]);

  return (
    <div ref={mapRef} className="map" style={{ height: '400px', width: '100%' }} />
  );
}

export default MapView;
